using System.Collections.Generic;
using Xunit;
using ShipWorks.Shipping.Carriers.Postal.Endicia;
using Moq;
using ShipWorks.Shipping.ScanForms;
using ShipWorks.Data.Model.EntityClasses;
using SD.LLBLGen.Pro.ORMSupportClasses;
using ShipWorks.Tests.Shared;
using Autofac.Extras.Moq;
using ShipWorks.Data.Model.EntityInterfaces;
using ShipWorks.Shipping.Carriers.Postal.Endicia.WebServices.LabelService;
using Interapptive.Shared.Pdf;
using System.IO;
using System;

namespace ShipWorks.Tests.Shipping.Carriers.Postal.Endicia
{
    public class EndiciaScanFormGatewayTest
    {
        private readonly AutoMock mock;
        private readonly Mock<IScanFormCarrierAccount> carrierAccount;
        private readonly Mock<IEndiciaApiClient> client;
        private readonly Mock<IPdfDocumentFactory> pdfFactory;
        private readonly Mock<IPdfDocument> pdfDoc;
        private readonly ScanFormBatch scanFormBatch;
        private const string scanReslut = "";
        private EndiciaScanFormGateway testObject;

        public EndiciaScanFormGatewayTest()
        {
            mock = AutoMockExtensions.GetLooseThatReturnsMocks();
            client = mock.Mock<IEndiciaApiClient>();
            client.Setup(c => c.GetScanForm(It.IsAny<IEndiciaAccountEntity>(), It.IsAny<IEnumerable<IShipmentEntity>>()))
                .Returns(new SCANResponse() { SCANForm = scanReslut });

            pdfDoc = mock.Mock<IPdfDocument>();

            pdfFactory = mock.Mock<IPdfDocumentFactory>();
            pdfFactory.Setup(p => p.Create(It.IsAny<PdfDocumentType>())).Returns(pdfDoc);

            carrierAccount = mock.Mock<IScanFormCarrierAccount>();
            carrierAccount.Setup(c => c.GetAccountEntity()).Returns(new EndiciaAccountEntity());

            testObject = mock.Create<EndiciaScanFormGateway>();

            scanFormBatch = new ScanFormBatch(carrierAccount.Object, null, null);
        }

        [Fact]
        public void CreateScanForms_ThrowsEndiciaException_WhenAccountEntityIsNull()
        {
            // Setup the GetAccountEntity method to return a null value
            carrierAccount.Setup(c => c.GetAccountEntity()).Returns((IEntity2)null);

            Assert.Throws<EndiciaException>(() => testObject.CreateScanForms(scanFormBatch, new List<ShipmentEntity>()));
        }

        [Fact]
        public void CreateScanForms_ThrowsEndiciaException_WhenShipmentsIsNull()
        {
            Assert.Throws<EndiciaException>(() => testObject.CreateScanForms(scanFormBatch, null));
        }

        [Fact]
        public void CreateScanForms_ThrowsEndiciaException_WhenShipmentsIsEmpty()
        {
            Assert.Throws<EndiciaException>(() => testObject.CreateScanForms(scanFormBatch, new List<ShipmentEntity>()));
        }

        [Fact]
        public void CreateScanForms_DelegatesToEndiciaApiClient()
        {
            var shipments = new List<ShipmentEntity>() { new ShipmentEntity()};
            testObject.CreateScanForms(scanFormBatch, shipments);

            client.Verify(e => e.GetScanForm((IEndiciaAccountEntity)scanFormBatch.AccountEntity, shipments));
        }
    }
}
